import Header from "../components/Header";
const Product = () => {
  return (
    <>
      <Header />
      <div className="row">
      <div className="col-md-6">
        <ProductFom />
      </div>
      <div className="col-md-6">
        <ProductList />
      </div>
    </div>
    </>
  );
};

export default Product;
